import React from "react";
/*import CountButton from "./CountButton/CountButton";*/
import SearchBar from "./SearchBar/SearchBar";

const App = () => {
  return (
    <div>
      ;
      <SearchBar
        products={[
          "tooth paste",
          "tooth brush",
          "mouth wash",
          "mouth guard",
          "dental floss",
        ]}
      />
      <SearchBar
        products={[
          "bike rack",
          "bike shit",
          "wheels",
          "tires",
          "bike seat",
          "bike bike",
        ]}
      />
    </div>
  );
};

export default App;
